import React from 'react'
import "./Dashboard.css";
import Profile from "./image/Profile.png";


const Dashboard = () => {
  return (
    <div className='container_1'>
      <div className='profile'>
        <img src={Profile} alt="" />

      </div>
    </div>
  )
}

export default Dashboard
